jobs.description:
Stiamo cercando un insegnante privato innovativo ed energico che si unisca al nostro eccellente team di tutor italiani. Stiamo cercando un insegnante qualificato che si unisca al nostro team di tutor professionisti che supportano i nostri studenti in tutte le fasi della loro istruzione.

Nella nostra azienda ti offriamo l'opportunità di entrare a far parte del nostro team di insegnanti che supportano gli studenti che hanno bisogno di aiuto nei loro studi scolastici quotidiani.

Nella nostra azienda stiamo assumendo insegnanti con conoscenze di Statistica quindi se sei disponibile a dare lezioni benvenuto a bordo!

Compiti
• Prepara un programma specifico per aiutare l'apprendimento dello studente;
• Comincia a dare lezioni private da subito;
• Serietà, puntualità e professionalità con gli studenti.

Requisiti
• Non è richiesta esperienza nell'insegnamento;
• Passione per l'insegnamento

Cosa offriamo
• Lavoro flessibile a domicilio/presenziale o da remoto / smart working: dai lezioni... dove e quando vuoi tu;
• Stabilisci tu la tua tariffa oraria;
• Trattandosi di un lavoro online, cerchiamo in tutta Italia (per favore, seleziona la località esatta al momento della candidatura);

Informazioni sull’azienda:
LeTueLezioni

Se sei un insegnante privato che desidera espandere la tua base di studenti e guadagnare di più, allora sei nel posto giusto!

LeTueLezioni è la piattaforma perfetta per connetterti con studenti desiderosi di imparare e fare la differenza nella loro vita educativa.

| Compiti |

- Progettare e condurre lezioni coinvolgenti ed efficaci;

- Fornire feedback dettagliato e supporto personalizzato agli studenti;

- Mantenere una comunicazione chiara e costante con gli studenti e i genitori.

| Requisiti |

- Esperienza nell'insegnamento o nell'ambito correlato;

- Capacità di adattare il materiale didattico alle esigenze degli studenti;

- Eccellenti capacità comunicative e relazionali;

- Disponibilità a lavorare in modalità online.

| Benefici |

Perché unirti a noi?

- Ampia visibilità: Accedi a una vasta rete di studenti in cerca di insegnanti qualificati come te;

- Flessibilità: Imposta il tuo orario e le tariffe che preferisci;

- Controllo totale: Gestisci le lezioni, le... prenotazioni e i pagamenti comodamente online e in accordo con lo studente;

- Supporto dedicato: Il nostro team è qui per aiutarti ad avere successo e a soddisfare le tue esigenze.

Non perdere l'opportunità di trasformare la vita degli studenti e la tua carriera di insegnante! Iscriviti ora su LeTueLezioni e inizia a insegnare nel modo che ami, quando vuoi e con la libertà che meriti.

Unisciti a noi oggi e fai la differenza nell'istruzione! Iscriviti ora su LeTueLezioni

