Letuelezioni è alla ricerca di un insegnante con passione ed energia per dare lezioni private di Disegno.

Vuoi guadagnare da casa? Accetta la sfida e inizia ora. Stiamo cercando uno studente, laureato o professionista che ricopra la figura di insegnante /docente /educatore /formatore di Disegno per dare lezioni online.

REQUISITI

- Diploma di Maturità;

- Non è richiesta esperienza pregressa nel ruolo di educatore/formatore/insegnante;

- Passione e propensione verso l'insegnamento di Disegno.

DETTAGLI OFFERTA

- Orario di lavoro flessibile;

- Luogo di lavoro: tutta Italia / da remoto o a domicilio;

- Retribuzione secondo il profilo e l’esperienza;

BENEFIT

- Flessibilità oraria;

- Telelavoro / smart working / da remoto;

- Potrai stabilire il prezzo delle tue lezioni.

